What you need:
- your choice of noodles (I use shirataki noodles for a zero calorie alternative) cooked according to package instructions
- chopped garlic, a LOT â¤ï¸
- sliced mushrooms (you can used canned button mushrooms or fresh white ones if you're a #fancyboi)
- canned corned tuna (like Century Tuna or San Marino Corned Tuna; I always use the spicy variant ğŸŒ¶ğŸ”¥)
- sliced sundried tomatoes (totally optional)
- sundried tomato pesto sauce (in this recipe I used Filippo Berio Sundried Tomato Pesto Sauce, but you may use any brand you prefer ğŸ˜‰)
- oil, just enough for stirfrying (I actually squeeze the oil from the corned tuna and used that instead hihi #protip)

Stirfry the garlic for a few seconds until fragrant (be careful not to burn it). Add the mushrooms (drained, if you're using canned ones). Add the corned tuna. Stirfry for a minute before adding the sundried tomatoes. Finally add the sundried tomato pesto sauce. Simmer for a minute or two. Pour over cooked pasta, or.... Mix the pasta into the sauce to incorporate it better. ğŸ‘ŒEnjoy! ğŸ’•
